CREATE TABLE IF NOT EXISTS data_ty (
    `id` INT PRIMARY KEY,
    `Name` VARCHAR(41) CHARACTER SET utf8,
    `Processor` VARCHAR(26) CHARACTER SET utf8,
    `Gpu` VARCHAR(38) CHARACTER SET utf8,
    `Display` VARCHAR(34) CHARACTER SET utf8,
    `Memory` VARCHAR(22) CHARACTER SET utf8,
    `Storage` VARCHAR(28) CHARACTER SET utf8,
    `Weight` VARCHAR(27) CHARACTER SET utf8,
    `Dimension` VARCHAR(79) CHARACTER SET utf8,
    `Battery` VARCHAR(29) CHARACTER SET utf8
);
